export default () => {
  return (
    // <!-- Header Start -->
	<header className="header clearfix">
		<div className="top-header-group">
			<div className="top-header">
				<div className="res_main_logo">
					<a href="index.html"><img src="images/dark-logo-1.svg" alt=""/></a>
				</div>
				<div className="main_logo" id="logo">
					<a href="index.html"><img src="images/logo.svg" alt=""/></a>
					<a href="index.html"><img className="logo-inverse" src="images/dark-logo.svg" alt=""/></a>
				</div>
				<div className="select_location">
					<div className="ui inline dropdown loc-title">
						<div className="text">
						  <i className="uil uil-location-point"></i>
						  Gurugram
						</div>
						<i className="uil uil-angle-down icon__14"></i>
						<div className="menu dropdown_loc">
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Gurugram
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								New Delhi
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Bangaluru
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Mumbai
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Hyderabad
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Kolkata
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Ludhiana
							</div>
							<div className="item channel_item">
								<i className="uil uil-location-point"></i>
								Chandigrah
							</div>
						</div>
					</div>
				</div>
				<div className="search120">
					<div className="ui search">
					  <div className="ui left icon input swdh10">
						<input className="prompt srch10" type="text" placeholder="Search for products.."/>
						<i className='uil uil-search-alt icon icon1'></i>
					  </div>
					</div>
				</div>
				<div className="header_right">
					<ul>
						<li>
							<a href="#" className="offer-link"><i className="uil uil-phone-alt"></i>1800-000-000</a>
						</li>
						<li>
							<a href="offers.html" className="offer-link"><i className="uil uil-gift"></i>Offers</a>
						</li>
						<li>
							<a href="faq.html" className="offer-link"><i className="uil uil-question-circle"></i>Help</a>
						</li>
						<li>
							<a href="dashboard_my_wishlist.html" className="option_links" title="Wishlist"><i className='uil uil-heart icon_wishlist'></i><span className="noti_count1">3</span></a>
						</li>	
						<li className="ui dropdown">
							<a href="#" className="opts_account">
								<img src="images/avatar/img-5.jpg" alt=""/>
								<span className="user__name">John Doe</span>
								<i className="uil uil-angle-down"></i>
							</a>
							<div className="menu dropdown_account">
								<div className="night_mode_switch__btn">
									<a href="#" id="night-mode" className="btn-night-mode">
										<i className="uil uil-moon"></i> Night mode
										<span className="btn-night-mode-switch">
											<span className="uk-switch-button"></span>
										</span>
									</a>
								</div>	
								<a href="dashboard_overview.html" className="item channel_item"><i className="uil uil-apps icon__1"></i>Dashbaord</a>								
								<a href="dashboard_my_orders.html" className="item channel_item"><i className="uil uil-box icon__1"></i>My Orders</a>
								<a href="dashboard_my_wishlist.html" className="item channel_item"><i className="uil uil-heart icon__1"></i>My Wishlist</a>
								<a href="dashboard_my_wallet.html" className="item channel_item"><i className="uil uil-usd-circle icon__1"></i>My Wallet</a>
								<a href="dashboard_my_addresses.html" className="item channel_item"><i className="uil uil-location-point icon__1"></i>My Address</a>
								<a href="offers.html" className="item channel_item"><i className="uil uil-gift icon__1"></i>Offers</a>
								<a href="faq.html" className="item channel_item"><i className="uil uil-info-circle icon__1"></i>Faq</a>
								<a href="sign_in.html" className="item channel_item"><i className="uil uil-lock-alt icon__1"></i>Logout</a>
							</div>
						</li>
					</ul>
				</div>
			</div>
		</div>
		<div className="sub-header-group">
			<div className="sub-header">
				<div className="ui dropdown">
					<a href="#" className="category_drop hover-btn" data-toggle="modal" data-target="#category_model" title="Categories"><i className="uil uil-apps"></i><span className="cate__icon">Select Category</span></a>
				</div>
				<nav className="navbar navbar-expand-lg navbar-light py-3">
					<div className="container-fluid">
						<button className="navbar-toggler menu_toggle_btn" type="button" data-target="#navbarSupportedContent"><i className="uil uil-bars"></i></button>
						<div className="collapse navbar-collapse d-flex flex-column flex-lg-row flex-xl-row justify-content-lg-end bg-dark1 p-3 p-lg-0 mt1-5 mt-lg-0 mobileMenu" id="navbarSupportedContent">
							<ul className="navbar-nav main_nav align-self-stretch">
								<li className="nav-item"><a href="index.html" className="nav-link active" title="Home">Home</a></li>
								<li className="nav-item"><a href="shop_grid.html" className="nav-link new_item" title="New Products">New Products</a></li>
								<li className="nav-item"><a href="shop_grid.html" className="nav-link" title="Featured Products">Featured Products</a></li>
								<li className="nav-item">
									<div className="ui icon top left dropdown nav__menu">
										<a className="nav-link" title="Pages">Pages <i className="uil uil-angle-down"></i></a>
										<div className="menu dropdown_page">
											<a href="dashboard_overview.html" className="item channel_item page__links">Account</a>
											<a href="about_us.html" className="item channel_item page__links">About Us</a>
											<a href="shop_grid.html" className="item channel_item page__links">Shop Grid</a>
											<a href="single_product_view.html" className="item channel_item page__links">Single Product View</a>
											<a href="checkout.html" className="item channel_item page__links">Checkout</a>
											<a href="request_product.html" className="item channel_item page__links">Product Request</a>										
											<a href="order_placed.html" className="item channel_item page__links">Order Placed</a>										
											<a href="bill.html" className="item channel_item page__links">Bill Slip</a>										
											<a href="sign_in.html" className="item channel_item page__links">Sign In</a>
											<a href="sign_up.html" className="item channel_item page__links">Sign Up</a>
											<a href="forgot_password.html" className="item channel_item page__links">Forgot Password</a>
											<a href="contact_us.html" className="item channel_item page__links">Contact Us</a>
										</div>
									</div>
								</li>
								<li className="nav-item">
									<div className="ui icon top left dropdown nav__menu">
										<a className="nav-link" title="Blog">Blog <i className="uil uil-angle-down"></i></a>
										<div className="menu dropdown_page">
											<a href="our_blog.html" className="item channel_item page__links">Our Blog</a>
											<a href="blog_no_sidebar.html" className="item channel_item page__links">Our Blog Two No Sidebar</a>
											<a href="blog_left_sidebar.html" className="item channel_item page__links">Our Blog with Left Sidebar</a>
											<a href="blog_right_sidebar.html" className="item channel_item page__links">Our Blog with Right Sidebar</a>
											<a href="blog_detail_view.html" className="item channel_item page__links">Blog Detail View</a>
											<a href="blog_left_sidebar_single_view.html" className="item channel_item page__links">Blog Detail View with Sidebar</a>
										</div>
									</div>
								</li>	
								<li className="nav-item"><a href="contact_us.html" className="nav-link" title="Contact">Contact Us</a></li>
							</ul>
						</div>
					</div>
				</nav>
				<div className="catey__icon">
					<a href="#" className="cate__btn" data-toggle="modal" data-target="#category_model" title="Categories"><i className="uil uil-apps"></i></a>
				</div>
				<div className="header_cart order-1">
					<a href="#" className="cart__btn hover-btn pull-bs-canvas-left" title="Cart"><i className="uil uil-shopping-cart-alt"></i><span>Cart</span><ins>2</ins><i className="uil uil-angle-down"></i></a>
				</div>
				<div className="search__icon order-1">
					<a href="#" className="search__btn hover-btn" data-toggle="modal" data-target="#search_model" title="Search"><i className="uil uil-search"></i></a>
				</div>
			</div>
		</div>
        <style jsx>{`
            
            
            /*--- Header ---*/

.header {
	position: fixed;
	z-index: 999;
	width: 100%;
	float: left;
	background: #fff;
	box-shadow: 0px 0.052083333in 11.25pt -9px rgba(0,0,0,.01);
}

.top-header-group {
    float: left;
    width: 100%;
    display: block;
}

.top-header {
    float: left;
    width: 100%;
    display: flex;
	height: 60px;
    align-items: center;
}

.main_logo {
    float: left;
    width: 125px;
    margin-left: 10px;
}

.blog_logo {
    padding: 12px 0px;
}

.logo-inverse {
    display: none;
}

.search120 {
    float: left;
    margin-left: 35px;
	width: 25%;
}

.main_logo img {
    width: 100%;
	padding-top: 0;
}

.res_main_logo {
	display: none;
	width: 45px;
}

.res_main_logo img {
    width: 100%;
	padding-top: 3px;
}

.srch10 {
	background: #f7f7f7 !important;
    border: 0 !important;
	color: #2b2f4c !important;
}

i.icon1 {
	font-size: 16px !important;
}

.ui.swdh10 {
    font-size: 14px !important;
    width: 100%;
}

.ui[class*="left icon"].swdh10.input>input {
    padding-left:3.2em!important;
    padding-right: 1em!important;
	font-size: 14px;
    font-weight: 500;
	border: 0 !important;
}

.ui.search .prompt {
    border-radius: .3rem !important;
	width: 100%;
}

.header_right {
    margin-left: auto;
    float: right;
    padding-right: 15px;
}

.header_right ul li {
    display: inline-block;
	vertical-align: middle;
}

.option_links {
    padding: 10px 9px;
    font-size: 20px;
    color: #91699c;
	position: relative;
}

.option_links i {
    font-size: 18px;
}

.option_links .icon_wishlist {
    background: rgba(246,151,51,0.2);
    color: #f69733;
    height: 35px;
    width: 35px;
    display: inline-block;
    padding: 10px 5px;
    border-radius: 100%;
}

.option_links .icon_noti {
    background: rgba(2,114,54,0.2);
    color: #027236;
    height: 35px;
    width: 35px;
    display: inline-block;
    padding: 10px 5px;
    border-radius: 100%;
}

.option_links:hover, .option_links:focus {
    color: #2b2f4c !important;
}

.noti_count {
    font-size: 11px;
	font-weight: 600;
    position: absolute;
    top: 0px;
    right: 8px;
    background: #027236;
    color: #fff;
    width: 16px;
    height: 16px;
    text-align: center;
    line-height: 1.5;
    border-radius: 100%;
    font-weight: 500;
}

.noti_count1 {
    font-size: 11px;
	font-weight: 600;
    position: absolute;
    top: 0px;
    right: 8px;
    background: #f69733;
    color: #fff;
    width: 16px;
    height: 16px;
    text-align: center;
    line-height: 1.5;
    border-radius: 100%;
}

.opts_account {
    font-weight: 500;
    color: #2b2f4c;
	float: right;
    padding: 5px 5px 5px 10px;
    background: #f9f9f9;
    border-radius: 10px;
    margin-left: 17px;
}

.opts_account img {
    width: 30px;
    border-radius: 50%;
    border: 1px solid #fff;
    box-shadow: 0px 2px 2px 0px rgba(0, 0, 0, 0.1);
    margin-left: 0;
}

.opts_account .user__name {
    margin-left: 10px;
	font-size: 13px;
}

.opts_account:hover {
    color: #f55d2c !important;
}

.icon__1 {
    font-size: 18px;
    margin-right: 10px;
}

.left_title {
    padding: 20px 17px 10px;
    font-size: 12px;
    font-weight: 500;
    color: #afafaf;
    text-align: left;
	margin-bottom: 0;
}

.user_img img {
    width: 30px;
    border-radius: 100%;
    margin-left: 17px;
    margin-right: 15px;
}

.menu.dropdown_account {
    margin-top: 10px !important;
    border-top: 1px solid #fff !important;
    border-radius: 3px !important;
}

.menu.dropdown_account_rl {
    min-width: 220px !important;
}

.rl-account-step p {
    font-size: 13px;
    font-weight: 400;
}

.rl-account {
    text-align: center;
    padding: 15px;
}

.rl-account-step {
    padding-bottom: 20px;
    margin-bottom: 15px;
    border-bottom: 1px solid #efefef;
}

.rl-account-step:last-child {
    padding-bottom: 0;
    margin-bottom: 0;
    border-bottom: 0;
}

.lr-acount-btn {
    display: inline-block;
    font-weight: 500;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    border: 1px solid transparent;
    -webkit-transition: color .15s ease-in-out,background-color .15s ease-in-out,border-color .15s ease-in-out,box-shadow .15s ease-in-out;
    transition: color .15s ease-in-out,background-color .15s ease-in-out,border-color .15s ease-in-out,box-shadow .15s ease-in-out;
    padding: 8px 10px;
    font-size: 14px;
    line-height: 16px;
    border-radius: 4px;
    color: #fff;
    background-color: #f55d2c;
}

.menu.dropdown_mn {
    width: 300px;
	margin-top: 12px !important;
    border-top: 1px solid #fff !important;
    border-radius: 3px !important;
	min-width: 300px !important;
}

.menu.dropdown_ms {
    width: 300px;
	margin-top: 12px !important;
    border-top: 1px solid #fff !important;
    border-radius: 3px !important;
	min-width: 300px !important;
}

